import React, {Component} from 'react'
import {Link} from 'react-router-dom'
import {withProvider} from './MyProvider'


class Navbar extends Component {
    constructor(){
        super()
        this.state = {
            toggle: false
        }
    }



    render(){
        return(
            <div className='nav'>
                <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b2/Hamburger_icon.svg/1200px-Hamburger_icon.svg.png" alt="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b2/Hamburger_icon.svg/1200px-Hamburger_icon.svg.png"/>
                <Link to='/'>Home</Link>
                <Link to='/sortinghat'>Sorting Hat</Link>
                <Link to='/search'>Search</Link>
                <Link to='/characters'>Characters</Link>
                <Link to='/spells'>Spells</Link>
            </div>
        )
    }
}

export default withProvider(Navbar)
